import { Toolbar,AppBar,Typography,makeStyles } from '@material-ui/core';

const headerStyle = {
  padding: 20,
};

const Header = () => (

  <AppBar style={headerStyle} position="static">
    <Toolbar>
      <Typography variant="h6" >
        LOGO
      </Typography>
    </Toolbar>
  </AppBar>
);

export default Header;
